unsigned int findMax(int *_values, unsigned int _size)
{
	int max = _values[0];
	unsigned int index = 0;
	unsigned int i;
	for(i=1; i<_size; i++)
	{
		if(_values[i]>max)
		{
			max = _values[i];
			index = i;
		}
	}
	return index;
}

